import React, { useEffect, useState } from "react";
import DogRunNameTag from "../assets/images/dogrun-nametag.png";
import "./DogRunNameTag.css";

const DogRunNameTags: React.FC = () => {
  const [showDogRunNameTags, setShowDogRunNameTags] = useState(false);

  useEffect(() => {
    // コンポーネントがマウントされたときにアニメーションを開始
    setTimeout(() => {
      setShowDogRunNameTags(true);
    },500);

  }, []); 


return (
  <div>
  <div className={`DogRunNametag ${showDogRunNameTags? "show" : ""}`}>
  <img src={DogRunNameTag} alt="ドッグランネームタグ" />
 </div>
 </div>
);
};

export default DogRunNameTags;
